C ABSELEMENT.FOR
C 5-MAY-1993 SMB
C MODIFIED 1-NOV-1994 SMB so get_string shifts to all lower case.
C********************************************************************
C  this routine returns an integer atomic number for a symbol name.
C*********************************************************************
      subroutine abselement( zed, symbol)
      implicit none
      character*2 element(92), symbol
      integer*4 zed, i, nchr
       data element/'h ','he','li','be','b ','c ','n ','o ','f ','ne',
     1           'na','mg','al','si','p ','s ','cl','ar',
     2  'k ','ca','sc','ti','v ','cr','mn','fe','co','ni','cu','zn',
     3       'ga','ge','as','se','br','kr',
     4  'rb','sr','y ','zr','nb','mo','tc','ru','rh','pd','ag','cd',
     5       'in','sn','sb','te','i ','xe',
     6  'cs','ba','la','ce','pr','nd','pm','sm','eu','gd','tb','dy',
     7       'ho','er','tm','yb','lu',
     8       'hf','ta','w ','re','os','ir','pt','au','hg',
     9       'tl','pb','bi','po','at','rn',
     1           'fr','ra','ac','th','pa','u '/

        call absup_low( symbol, 2)
        
        do i=1,92       ! loop through for match
            if( symbol.eq. element( i)) then
                zed = i
                call abslow_up(symbol(1:1),1)
                return
            end if
        end do
c        write(*,'('' Symbol not recognized'')')
        zed = 0
        return
        end

C convert lower case to upper case
        subroutine abslow_up( string, len)
        implicit none
        character*(*) string
        character*26 lower/'abcdefghijklmnopqrstuvwxyz'/
        character*26 upper/'ABCDEFGHIJKLMNOPQRSTUVWXYZ'/
        integer*4 len, j, i

        if( len .gt. 0) then
            do i=1,len
                j= index( lower,string(i:i))
                if( j.gt. 0) string(i:i)= upper(j:j)
            end do
        end if
        return
        end

C convert upper case to lower case
        subroutine absup_low( string, len)
        implicit none
        character*(*) string
        character*26 lower/'abcdefghijklmnopqrstuvwxyz'/
        character*26 upper/'ABCDEFGHIJKLMNOPQRSTUVWXYZ'/
        integer*4 len, j, i

C executable code
        if( len .gt. 0) then
            do i=1,len
                j= index( upper,string(i:i))
                if( j.gt. 0) string(i:i)= lower(j:j)
            end do
        end if
        return
        end

